INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24015, "2030/12/17 14:59:59", 10021, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 0.0, "カオリ（サマー）", 4, 4);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24016, "2030/12/17 14:59:59", 10021, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 4.0, "カオリ（サマー）", 4, 1);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24017, "2030/12/17 14:59:59", 10021, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 0.0, "カオリ（サマー）", 4, 4);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24018, "2030/12/17 14:59:59", 10021, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 5.2, "カオリ（サマー）", 1, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24019, "2030/12/17 14:59:59", 10021, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 4.2, "カオリ（サマー）", 5, 6);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24020, "2030/12/17 14:59:59", 10021, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 0.0, "カオリ（サマー）", 2, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24021, "2030/12/17 14:59:59", 10021, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 6.4, "カオリ（サマー）", 1, 6);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24022, "2030/12/17 14:59:59", 10021, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 0.0, "カオリ（サマー）", 2, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24023, "2030/12/17 14:59:59", 10021, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 10.08, "カオリ（サマー）", 6, 3);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24024, "2030/12/17 14:59:59", 10021, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 5.0, "カオリ（サマー）", 1, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (110501, 24, 0.0, 0.0, 24025, "2030/12/17 14:59:59", 10021, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 0.0, "カオリ（サマー）", 2, 2);
